import React from "react";
import { View, Text, StyleSheet, Image } from "react-native";
import {
  Container,
  Header,
  Content,
  Input,
  Item,
  Button,
  StyleProvider,
} from "native-base";
// import { AntDesign } from "@expo/vector-icons";

export default function Login() {
  return (
    <Container>
      <View style={styles.titlecontainer}>
        <Text>간단한 설문을 통해 맞춤 식물을 추천해 드립니다.</Text>
      </View>
      <View style={styles.contentcontainer}>
        <Image
          source={{
            uri:
              "https://www.ikea.com/kr/en/images/products/smycka-artificial-flower-rose-red__0903311_pe596728_s5.jpg",
          }}
          style={styles.contentimg}
        />
        <Text style={styles.contentdesc}>
          본 테스트는 사용자의 설문조사 입력 데이터를 바탕으로 사용자의 성향에
          맞는 식물을 추천하기 위한 설문입니다.본인의 생활패턴과 성향을 있는
          그대로 답변해주세요.
        </Text>
        <View style={styles.contentinfo}>
          <View></View>
          <View></View>
        </View>
      </View>
      <View style={styles.buttoncontainer}>
        <Text>hi</Text>
      </View>
    </Container>
  );
}

const styles = StyleSheet.create({
  titlecontainer: {
    flex: 2,
    justifyContent: "flex-end",
    alignItems: "center",
  },
  contentcontainer: {
    flex: 6,
    justifyContent: "center",
    alignItems: "center",
  },
  buttoncontainer: {
    flex: 2,
    justifyContent: "center",
    alignItems: "center",
  },
  contentimg: {
    flex: 5,
    alignSelf: "stretch",
  },
  contentdesc: {
    flex: 2,
  },
  contentinfo: {
    flex: 2,
  },
});
